import React from "react";
import Header from "./Header/Header";
import Central from "./AboutUs/Central";
import Footer from './Footer/Footer.js';

const AboutUs = () => {
    return(
        <div>
            <Header></Header>
            <Central></Central>
            <Footer></Footer>
        </div>
    )
}

export default AboutUs;
